import React from "react";
import img from "./images/Designer.png";

export default function Home() {
  return (
    <>
      <div
        style={{
          backgroundImage: `url(${img})`,
          height: "100vh",
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover", // Using cover instead of auto for background size
          backgroundPosition: "center",
          maxWidth: "100%", // Ensuring the div stretches to full width
        }}
        className="img-fluid"
      ></div>
    </>
  );
}
